import './AboutPage.scss';

function AboutPage() {
    return (
        <article className="about-page">
            <div className="about-page__wrap">
                <h1 className="about-page__title">About</h1>
                <p>I'm a full-stack web developer, currently based in Kamloops, BC.</p>
                <p>The world of tech entered my life as a kid when my dad started building computers from scratch as a hobby. From age 10 on, every time he built a newer, more powerful computer, I inherited the « older » one. My first recollection of hacking any software was to earn more money in order to build bigger, better houses in the video game Sims (#motherlode), then I went on to creating fun visuals on a cracked version of Photoshop (#sorryAdobe), and the rest is history. Computers were fun. I was hooked!</p>
                <p>In 2015, I graduated from a Bachelor in Communication and Media. This is where I truly discovered the power of coding, studying the basics of html, css and javascript, and realizing that loving both creativity and logic was not a paradox.</p>
                <p>After a few years working in marketing and keeping coding on the recreational side, I decided to pursue a formal education in web development at BrainStation where I graduated from a Diploma in Web Development.</p>
                <p>I am now looking for my next adventure. If my story resonates with you, feel free to say hello!</p>

                <h2 className="about-page__subtitle">Skillset</h2>
                <div>
                React, JavaScript (ES6), HTML5, CSS, SCSS, REST API, Git Version Control, Adobe Photoshop, Adobe Illustrator, Adobe InDesign,
                </div>
            </div>
        </article>
    );
}

export default AboutPage;
